jQuery(document).ready(function($){"use strict";function wpProcessConsentLevelChange(consentLevels){console.log(consentLevels);for(var key in consentLevels){if(consentLevels.hasOwnProperty(key)){clapiSetCookie("wp_consent_"+key,consentLevels[key][0],cookie_expiry)}}$.event.trigger({type:"wpListenForConsentLevelChange",consentLevels:consentLevels})}$(document).on("wpApplyConsentLevelChange",wpProcessConsentLevelChange);function wpHasConsentLevel(){}function clapiSetCookie(name,value,days){var secure=";secure";var date=new Date;date.setTime(date.getTime()+days*24*60*60*1e3);var expires=";expires="+date.toGMTString();if(window.location.protocol!=="https:")secure="";document.cookie=name+"="+value+secure+expires+";path=/"}function clapiGetCookie(cname){var name=cname+"=";var cArr=window.document.cookie.split(";");for(var i=0;i<cArr.length;i++){var c=cArr[i].trim();if(c.indexOf(name)==0)return c.substring(name.length,c.length)}return""}});